import React from 'react';

function Team() {
    return ( 
        <div className='container'>
            <div className='row'>
                <h2 class='text-center'>People</h2>
                <div className='col-6'>
                    <img src='Media\Images\nithinKamath.jpg'></img>
                    <h4 class="text-center">Nithin Kamath</h4>
                    <h5 class="text-">Founder, CEO</h5>
                   
                </div>
                <div className='col-6'></div>
            </div>
        </div>
     );
}

export default Team;
